import React from 'react';
import './App.css';
import CompletedCourse from './CompleCourse';
import Course from './Course';

class CompletedCourseArea extends React.Component {
  getCourses() {

    let courses = [];

    for (const course of Object.values(this.props.compleCourses.data)) {
      // search
      courses.push(
        <h3>course</h3>
      )

    }

    return courses;
  }

  render() {
    return (
      <React.Fragment>
<div class="h-100">
          <h3><strong>Course Cart</strong></h3>
          <h3 style={{display: this.props.compleCourses.data == null ? "none":"block"}}> No courses/sections/subsections added yet. <br></br> Go to "Seach" to add them!</h3>
          {this.getCourses()}
        </div>
      </React.Fragment>
    );
  }
}

export default CompletedCourseArea;
